import React from 'react';
import ReactDOM from 'react-dom';
import './dev-assets/style.scss';
import App from './App';

import { Provider } from 'react-redux';
// import store from './redux/store';


ReactDOM.render(
  <Provider >
    <App />
  </Provider>,

  document.getElementById('root')
);


